import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
    <NavLink activeClassName="" to="/home"></NavLink>
    <NavLink activeClassName="" to="/Service">Service</NavLink>
    <NavLink activeClassName="" to="/About">A</NavLink>
    <NavLink activeClassName="" to="/Contact"></NavLink>
    </>
  )
}
export default Navbar;
